import React, { Component } from 'react';



//these are all from Maze Game file
// import MainTemplate from '../pages/MainTemplate';
// import Template from '../pages/Template';



import { Unity, useUnityContext } from "react-unity-webgl";


export default function App() {


    const { unityProvider } = useUnityContext({
        loaderUrl: 'Build/SampleWebGLBuild.loader.js',
        dataUrl: 'Build/SampleWebGLBuild.data',
        frameworkUrl: 'Build/SampleWebGLBuild.framework.js',
        codeUrl: 'Build/SampleWebGLBuild.wasm',
    });


    return <Unity unityProvider={unityProvider} style={{ width: 800, height: 600 }} />;
}
